// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract ContratoFirma {
    struct Firma {
        address firmante;
        uint8 v;
        bytes32 r;
        bytes32 s;
        uint256 timestamp;
    }

    struct Documento {
        bytes32 hash;
        Firma[] firmas;
    }

    mapping(bytes32 => Documento) public documentos;

    // Evento para registrar firmas de documentos
    event FirmaDocumentoRegistrada(
        bytes32 indexed hash,
        address indexed firmante,
        uint8 v,
        bytes32 r,
        bytes32 s,
        uint256 timestamp
    );

    // Almacenar la firma del documento
    function almacenarFirmaDocumento(
        bytes32 hash,
        address firmante,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) public {
        Firma memory nuevaFirma = Firma(firmante, v, r, s, block.timestamp);
        documentos[hash].hash = hash;
        documentos[hash].firmas.push(nuevaFirma);

        // Emitir el evento con los datos de la firma
        emit FirmaDocumentoRegistrada(hash, firmante, v, r, s, block.timestamp);
    }
}
